import apiURL from "../apiUrl";
import axiosInstance from "../baseAxios";

const getUserById = (pk) => {
  let username;
  axiosInstance.get("user/list/" + pk).then((res) => console.log(res));
  return username ? username : "Anonymous";
};

export default getUserById;
